INSERT INTO `torneos` VALUES (53,'Torneo Nacional WKC ´24','Evento de máxima importancia nacional en un año, mismo que dará más puntos que cualquier otro y el primer lugar de cada división obtendrá su boleto para el campeonato mundial sin necesidad de hacer todo un circuito, esto se hace con la intención de beneficiar a atletas que se encuentran lejos de la zona metropolitana, que se les dificulta asistir a varios eventos en el año pero que tienen excelente nivel o que pertenecen a otras ligas o simplemente que hayan estado lesionados u ocupados en otras actividades como estudios o viajes.','2024-05-18 09:00:00','Blv. Gustavo Diaz Ordaz #86, Cuernavaca Morelos','https://karate.strappberry.com/storage/Img/torneos/67394590-7b5f-475a-8029-1e5217c1747c.jpg',NULL,'2024-02-18 01:19:37','2025-03-29 05:11:39','2024-04-18 19:50:21','[]','[]',1),(59,'CD TOLLOACAN 2024','Sean todos bienvenidos, Padres de familia, Alumnos y Profesores a un Torneo de gran tradición en la\nCiudad de Toluca, que ahora se ha convertido en un evento más de la WKC – México en una franca y\nsolida expansión de la mejor liga en el país. Este Torneo cuenta con la gran experiencia de la\nOrganización Okinawa Karate Do y ofrece más de 130 categorías en una fiesta marcial.','2024-12-30 09:00:00','“Martín Alarcón Hisojo” Av. La Hortaliza S/N entre Calle José Ma. Morelos, Av. Las torres y Calle Leona Vicario. Barrio de Coaxustenco, Metepec, Estado de México.','https://registro.wkcmexico.com/storage/Img/torneos/4a611c21-797e-4867-8967-ebde0c80ead4.png',NULL,'2024-10-21 16:27:03','2025-03-29 05:11:39','2024-12-29 00:00:00','[\"Gran campeón de Formas tradicionales varonil $1,000.00\", \"Gran campeón de Formas tradicionales damas $1,000.00 \", \"Gran campeón de Combate varonil $1,000.00\", \"Gran campeón de Combate damas $1,000.00\", \"Equipo campeón adultos $3,000.00 (con un mínimo de 4 equipos participantes por rama)\"]','[\"320\", \"300\", \"12\", \"10\", \"8\", \"6\", \"4\", \"2\"]',1),(61,'Mexican Best Fighter 25','Estimado profesor, competidor y padre de familia, es un honor hacerle la más cordial\ninvitación a éste su campeonato internacional MEXICAN BEST FIGHTER´25\n\nComo cada año, hemos preparado un evento donde tu experiencia sea excelente y donde\nla pieza fundamental para el éxito eres tú. Agradezco de antemano que nos acompañes\nen esta edición.','2025-02-22 07:39:00','Universidad Justo Sierra, CDMX','https://registro.wkcmexico.com/storage/Img/torneos/cc17b8fa-08d1-4b9c-bb63-662a0cc74303.jpg',NULL,'2025-01-17 19:39:15','2025-03-29 05:11:39','2025-02-21 07:41:00','[\"Medallas y Trofeos\", \"PREMIOS EN EFECTIVO\", \"\"]','[\"320 puntos a 1er lugar y hasta 8° lugar reciben 120 pts\"]',1),(64,'\"NACIONAL WKC MÉXICO\" ´25 Rumbo a Niagara WKC wolrd´s 2025','- Evento con mayor valor de puntos para RANKING oficial de WKC MÉXICO. -\n\n- Puedes competir en 400 diferentes divisiones, donde se RESPETA edad, genero y peso.                                                                                  \n\n- En FORMAS se compite por separado:     \n *WUSHU* (formas Chinas),           \n*KENPO* (formas Polinesias),           \n*TAEKWONDO (formas Coreanas),            \n*KARATE (formas japonesas) y            \n* Formas ABIERTAS (formas con modificaciones)          \n\n- Para COMBATE existen la modalidad de pelea PUNTOS y pelea CONTINUA, cada una dividida por edades y 4 diferentes rangos de peso en cada edad, TODAS DIVIDIDAS EN VARONIL Y FEMENIL.\n','2025-05-16 08:00:00','Holiday Inn Cuernavaca','https://registro.wkcmexico.com/storage/Img/torneos/96bd277c-cb41-49e7-aa6e-cb69d1eceac2.png',NULL,'2025-01-30 00:21:38','2025-04-29 01:57:16','2025-05-17 08:00:00','[\"Hospedaje para WKC WORLD´S en NIAGARA 2025 a Grandes Campeones por designar\", \"Carta física de Campeón Nacional WKC 2025 con sello\", \"PIN conmemorativo\", \"Ingreso automático a Selección Nacional Oficial WKC 2025\", \"Juguetes para algunos campeones infantiles\", \"Gran Campeón en Todas las divisiones de GRADO MENOR -17 años \"]','[\"320 puntos a 1er lugar y hasta 8° lugar reciben 120 pts\", \"Título de campeón Nacional\"]',1),(65,'Torneo Interclubes OKINAWA KARATE-DO','Logra puntos para sumar en Ranking WKC México, en cintas negra.\n\nEn Grado Menor el mejor ambiente familiar y experiencia de competencia, con entorno seguro y Familiar','2025-02-23 08:30:00','Centro Universitario México','https://registro.wkcmexico.com/storage/Img/torneos/ae2ca4f2-500f-4d8e-8359-4cb73837919f.jpg',NULL,'2025-02-09 06:38:15','2025-03-29 05:11:39','2025-02-17 23:38:00','[\"Trofeo para Categoría Especial\", \"Medalla coleccionable para ganadores de competencia\"]','[]',1),(67,'Ragnarok','22 de Marzo en AMECAMECA\n\n','2025-02-23 08:29:00','Unidad Deportiva Amecameca','https://registro.wkcmexico.com/storage/Img/torneos/5ea84bb2-444d-4917-83b7-0f01264ea225.jpg',NULL,'2025-02-09 06:53:08','2025-03-29 05:11:39','2025-02-21 23:59:00','[\"Trofeos a Primero, segundo y tercer lugar \"]','[\"120 puntos a primeros lugares\"]',1),(68,'4to Torneo-Homenaje \"Shihan Rosa Elva González\" 2025','El legado de una Guerrera continua....\n\nPromotor Shihan Christian Munjía\n\n','2025-09-06 08:00:00','CDMX','https://registro.wkcmexico.com/storage/Img/torneos/6204d083-871d-4f03-8f00-5064f7b8e4da.jpg',NULL,'2025-02-09 07:00:36','2025-03-29 05:11:39','2025-09-01 23:59:00','[\"Trofeos y medallas a primeros lugares\"]','[\"120 puntos a 1eros Lugares en Ranking oficial WKC México\"]',1),(69,'OPEN FIGHT','Promotores Daniel Altamirano y Miguel Domínguez','2025-05-17 08:30:00','Deportivo Moctezuma Oriente158 #225 colonia Moctezuma    Edo. de Mex.','https://registro.wkcmexico.com/storage/Img/torneos/501007d4-90bf-471c-9306-658320fce2db.jpg',NULL,'2025-02-09 07:23:13','2025-04-16 22:21:21','2025-05-17 23:59:00','[\"Medallas o trofeos a 1°, 2do y 3er lugar de cada división\", \"1,000 pesos en Open weight varonil\", \"1,000 pesos en Open weight femenil\"]','[\"120 pts a primeros lugares\"]',1),(70,'Impacto Marcial','gran Toren